import { useState, useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';

import { BrowserRouter as Routers, Route, Routes } from 'react-router-dom';

import HomePage from './pages/home/home-page.component'
import CollectionPage from './pages/collection/collection.component';

import './App.css';
import {fetchCollectionStart} from './redux/collection/collection.actions';
import {selectCollections} from './redux/collection/collection.selectors';

const App = () => {
	const dispatch = useDispatch();
	const collections = useSelector(selectCollections) 
	const data = fetchCollectionStart()
	useEffect(() => {
		dispatch(data)
	}, [dispatch]);
	console.log(collections[0])
	return (
		<div className='App'>
			<h1 className='app-title'>NFT collection</h1>
			<Routers>
				<Routes>
					<Route exact path="/" Component={HomePage} />
					{
						collections.forEach((collection) => { 
							<Route path={`/${collection.collection_name}`} render={() => <CollectionPage/>} />
						})
					}
				</Routes>
			</Routers>
		</div>
	);
};

export default App;
